import { NavLink } from "react-router-dom";
import { Button } from "@material-ui/core";
const Btn = (props) => {
  return (
    <>
      <Button color="inherit" exact component={props.page} to={props.link}>
        {props.btnName}
      </Button>
    </>
  );
};
export default Btn;
